import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';
import React, { useState, useEffect } from 'react';
import axios from 'axios';

function CarCard({ car }) {
  return (
    <Card style={{ width: '18rem' }}>
      <Card.Img variant="top" src={`http://localhost:8000/storage/${car.image}`} alt="car image" /> 
      <Card.Body>
        <Card.Title>{car.brand} {car.model}</Card.Title>
        <Card.Subtitle className="mb-2 text-muted">{car.year}</Card.Subtitle>
        <Card.Text>
          Gearbox: {car.gearbox}<br />
          Fuel: {car.fuel}<br />
          Price: {car.price}<br />
        </Card.Text>
        <Button variant="primary" disabled={!car.available}>Rent Now</Button>
      </Card.Body>
    </Card>
  );
}

function CarCards() {
  const [cars, setCars] = useState([]);

  useEffect(() => {
    async function fetchData() {
      const response = await axios.get(`http://localhost:8000/api/cars`);
      setCars(response.data);
      console.log(response.data);
    }
    fetchData();
  }, []);

  return (
    <div className="d-flex justify-content-between flex-wrap">
      {cars.map(car => (
        <CarCard key={car.id} car={car} />
      ))}
    </div>
  );
}

export default CarCards;
